import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom' 
import dotenv from "dotenv";

dotenv.config();

ReactDOM.render(
	<BrowserRouter className="jawn">
		<App/>
	</BrowserRouter>,
	document.getElementById('root')
)
